import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './CoachLive.css';


import { Stage, Layer, Rect, Text } from 'react-konva';
import Konva from 'konva';
import NoteView from './NoteView.js'


export default function Map() {

  return (
    <Container fluid id="mapContainer">
      <NoteView />

      <Row id="mapRow">
        <MapBody />
      </Row>
    </Container>
  );
}






function NoteTab(props) {
  const isShowing = props.show;
  console.log(isShowing);


  const render = () => {
    if(isShowing === false) {
      return(<div></div>);
    }
    else {
      console.log('showing');
      return(
        <form id="noteBox">
          <label id="noteTime"> Time: 42:35</label>
          <textarea placeholder="enter note" id="noteContent" />
          <button>Enter</button>
        </form>

      );
    }
  }

  return (
    <div>
     {render()}
    </div>
  );
}

function MapBody() {
  return(
    <div id="mapBodyDiv">Epic nice</div>
  )
}
